ReactDOM.render((
  <Router history = {browserHistory}>
     <Route path = "/" component = {App}>
        <Route path = "home" component = {App} />
        <Route path = "About" component = {About} />
        <Route path = "AddNewWebsite" component = {AddNewWebsite} />
     </Route>
  </Router>
), document.getElementById('app'))
